int totalStrength(vector<int>& nums) {

       int n = nums.size();
       int mol = 1e9 + 7;
       int ans = 0;
       for(int i = 0; i < n ; ++i){
           int left = 0, right = 0, sum = 0, minNum = 1000001;
           while(right < n){
               sum += nums[right];
               minNum = min(minNum, nums[right]);
               right++;
               if(right- left == i + 1){
                   //cout<<minNum * sum << " ";
                   int tmp = (minNum * sum) % mol;
                    ans = ans % mol;
                   ans += tmp;
                   sum -= nums[left];
                   if(minNum == nums[left]){
                       if(left != n-1)//边界可以不断尝试
                       minNum = *min_element(nums.begin() + left + 1, nums.begin() + right );
                   }
                   left++;

               }
           }
       }
       return ans; 
    }
